import React ,{useEffect, useState} from "react";

const Profil =()=>{
    const [formData, setFormData]=useState({
        "korisnickoIme": "",
        "email": "",
        "lozinka": "",
        "ime": "",
        "prezime": "",
        "datumRodjenja": "2000-01-01",
        "adresa": "",
        "tipKorisnika": 0,
        "slikaKorisnika": "",
        "verifikovan": true,
        "postarina": 0
    });

    //state za cuvanje podatka sa server
    const [korisnikPodaci, setKorisnikPodaci]=useState(null);

    useEffect(()=>{
        fetch('https://localhost:44388/Korisnik?idKorisnika=4', {//zakucala jednog korisnika
            method: 'GET',
            body: JSON.stringify(formData),
            headers: {
                'Content-Type': 'application/json',
            },
            mode: 'cors',
        }) 
        .then((Response)=> Response.json())
        .then((data)=>{
            //obrada odgovora servera
            setKorisnikPodaci(data);
            setFormData(data);
        })
        .catch((error) => {
            //obrada greske
            console.error("Greška prilikom dobavljanja podataka sa servera:", error);
        }); 
    }, []);

    const handleChange=(e)=>{
        const {name, value} = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleSubmit =(e)=>{
        e.preventDefault();
        // Fetch zahtev za slanje izmenjenih podataka na server
    
    };

    return(
        <div>
            {korisnikPodaci ? (
                <form onSubmit={handleSubmit}>
                    <label>
                        Korisnicko ime:
                        <input
                            type="text"
                            name="korisnickoIme"
                            value={formData.korisnickoIme}
                            onChange={handleChange}
                        />
                    </label>
                    <labell>
                        E-mail:
                        <input
                            type="email"
                            name="email"
                            value={formData.email}
                            onChange={handleChange}
                        />
                    </labell>
                    <labell>
                        Lozinka:
                        <input
                            type="password"
                            name="lozinka"
                            value={formData.lozinka}
                            onChange={handleChange}
                        />
                    </labell>
                    <labell>
                        Ime:
                        <input
                            type="text"
                            name="ime"
                            value={formData.ime}
                            onChange={handleChange}
                        />
                    </labell>
                    <labell>
                        Prezime:
                        <input
                            type="text"
                            name="prezime"
                            value={formData.prezime}
                            onChange={handleChange}
                        />
                    </labell>
                    <labell>
                        Datum rodjenja:
                        <input
                            type="date"
                            name="datumRodjenja"
                            value={formData.datumRodjenja}
                            onChange={handleChange}
                        />
                    </labell>
                    <labell>
                        Adresa:
                        <input
                            type="text"
                            name="adresa"
                            value={formData.adresa}
                            onChange={handleChange}
                        />
                    </labell>
                    <labell>
                        Slika:
                        <input
                            type="text"
                            name="slikaKorisnika"
                            value={formData.slikaKorisnika}
                            onChange={handleChange}
                        />
                    </labell>
                    {formData.tipKorisnika === 'Prodavac' && (
                        <div>
                            <label htmlFor="postarina">Postarina:</label>
                                <input
                                    type="number"
                                    id="postarina"
                                    name="postarina"
                                    value={formData.postarina}
                                    onChange={handleChange}
                                    required
                                />
                                <br/>
                        </div>
                    )}
                    <button type="submit">Sacuvaj izmene</button>
                </form>
            ) : (
                <p>Ucitavanje podataka...</p>
            )}
        </div>
    );
};

export default Profil;
